import React from 'react';
import Histogram from 'react-chart-histogram';

function GraphLine() {      

    const labels = ['2017', '2018','2019','2020','2021','2022'];
    const data = [50, 600];
    const options = { fillColor: '#8D8DC5', strokeColor: '#FFFFFF'};
    return (
    <div >
      <Histogram
        xLabels={labels}
        yValues={data}
        options={options}
        width= '720'
        height= '400'
      />
    </div>
  );

}
    export default GraphLine
